import React from 'react';
import board from './board.PNG';
import './App.css';
import UserComponent from './component/UserComponent';

function App() {
    return (
        <div className="App">
            <UserComponent />
            <img src={board} />
            <div>
                <button type="button">Click Me</button>
            </div>
        </div>
    );
}

export default App;
